import 'package:ieca_mobile/_import.dart';

class UmLitanyContentSeeder{

  static List<LitanyContent> items() {
    return [
      LitanyContent(id: 130, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Hav.2:20", content: "Yehova o kasi vonembele yaye yi kola: omanu vosi vohile kovaso aye"),
      LitanyContent(id: 131, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.85:8", content: "Njeva eci ci popia Suku Yehova, momo o popia ombembua lomanu vaye"),
      LitanyContent(id: 132, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.46:1", content: "Suku eye ocikolo cetu, haeye ukuaku kolisa. Eye Oñuatisi, kohali o moleha lombili"),
      LitanyContent(id: 133, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.46:2", content: "Oco ka tu yokoka, ndãno oluali lu pongoloka, ndãno olomunda vi undumuhila vokati kokalunga"),
      LitanyContent(id: 134, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.130:5", content: "Imbi ovaso ku Yehova, momo ku Yehova ku kuete ohenda; kokuaye kuli eyovo lialua"),
      LitanyContent(id: 135, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.34:3", content: "Njimba ovaso ku Yehova. Utima wange U wimbila ovaso. Ndavoka kondaka yaye"),
      LitanyContent(id: 136, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.34:3", content: "Kemainyi Yehova unene, kumuamue lame. Tu pandiyili pamosi onduko yaye"),
      LitanyContent(id: 137, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.96:4", content: "Momo Yehova unene, kuenje wa posokela esivayo lia piãla"),
      LitanyContent(id: 138, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.103:8", content: "Yehova ukuahenda, o kasi locali; o livala konyeño. Ocisola caye calua cimue"),
      LitanyContent(id: 139, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.103:10", content: "Ka lingile letu eci ca soka lovakandu etu. Eci ca sesamela olohole vietu, hacoko a tu muisa"),
      LitanyContent(id: 140, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "", content: "Ndeci kilu kua lepa loposi, haico ocisola caye calua, kuava vo sumbila"),
      LitanyContent(id: 141, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.103:12", content: "Ndeci kutundilo kupãla lutakelo, haico oku lueya kuetu a ku kapa ocipãla letu"),
      LitanyContent(id: 142, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Ols.3:5", content: "Kolela Suku lutima wove wosi. Ku ka lipandiye lolondunge viove muele"),
      LitanyContent(id: 143, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "Osm.139:23-24", content: "Ñulihise, a Suku. Kuliha utima wange. Seteke. Kuliha ovisimilo viange, hu vanji nda nãsi lovituwa vieviho. Songuile vonjila ka yi pui"),
      LitanyContent(id: 144, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "1Yoan.3:1", content: "Tali ocisola ca piãla, ndomo Tate a tu ci iha, okuti tua tukuiwa omãla va Suku"),
      LitanyContent(id: 145, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.EKOVONGO_LIOKUFENDELA, books: "2Kor.9:15", content: "Pandu pandu ku Suku, mekonda liocali caye calua"),

      LitanyContent(id: 146, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "Osm.80:1-2", content: "Yevelela, ongombo wa Isareli. Ove o songuila Yosefe, ndocunda colomeme. Okuakutumalã ku va Keruvi, litukulula kovaso a Efarimi la Benjamin, kuenda Manase. Pindula ongusu yove. Enju o tu popele"),
      LitanyContent(id: 147, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "Osm.80:7,19", content: "Tu tumbulule a Yehova, Suku yolohoka. Tuisa ocipala cove, oco tu yovoke"),
      LitanyContent(id: 148, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "Osm.80:8", content: "Ove wopa ve Engito uti wayuva. Wa lupula olofeka kuenje wo tuika. Wo wangiliyila osi. Ovi viawo via tanda, kuenje wa yandela vofeka"),
      LitanyContent(id: 149, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "", content: "Tu tumbulule a Yehova, Suku yolohoka. Tuisa ocipala cove, oco tu yovoke"),
      LitanyContent(id: 150, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "Osm.80:14-15", content: "A Suku yolohoka, tua likutilila kokuove, pongoloka. Kilu o kasi vanja posi. Tala! Kulihisa uti waco. Popela uti wa tuika eka liove liondio"),
      LitanyContent(id: 151, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "", content: "Tu tumbulule a Yehova, Suku yolohoka. Tuisa ocipala cove, oco tu yovoke"),
      LitanyContent(id: 152, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "Osm.51:1.10", content: "Tu linge ohenda, a Suku, omo o kasi locisola ka ci pui. Omo ohenda yove yalua, imula okulueya kuetu. Tu sowille utima u yela, a Suku, kapa vokati ketu Espiritu liokaliye liesunga"),
      LitanyContent(id: 153, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "", content: "Tu tumbulule a Yehova, Suku yolohoka. Tuisa ocipala cove, oco tu yovoke"),
      LitanyContent(id: 154, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "Osm.51:2, 4, 12, 15, 17", content: "Tu sukule ciwa keviho lietu. Tu yelise, kekandu lietu. Ove, lika wove, tua ku lingila ekandu, loku linga eci ca vĩha kovaso ove. Eci wa tu pisa laco cocili, lonimbu wa tu tetela, ya sunguluka. A Yehova, situlula ovimela vietu, kuenje mu tunda esivayo liove. Tu tiuwile esanju lieyovo liove. Tu kolise lutima wombili. A Suku, ove ku timi utima wa teka, haiwo wa samba"),
      LitanyContent(id: 155, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "", content: "Tu tumbulule a Yehova, Suku yolohoka. Tuisa ocipala cove, oco tu yovoke"),
      LitanyContent(id: 156, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "Ovl.11.17-18", content: "Oco, nda Suku wa va iha ocali cimuamue, leci a tu iha etu, eci tua tava ku Nãla Yesu Kristu, ame elie, okuti nela oku tamãlala la Suku? Ocili vakualofeka lavovo, Suku wa va iha utima woku likekembela akandu, okuti va mola omuenyo"),
      LitanyContent(id: 157, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "", content: "Tu tumbulule a Yehova, Suku yolohoka. Tuisa ocipala cove, oco tu yovoke"),
      LitanyContent(id: 158, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "Ovilinga 11:12,15; Roma 8:14", content: "Kuenje Espiritu wa mañinya hati, Kuende lavo. Ku ka tatãle. Eci nda fetika oku popia, Espiritu Sandu wa va wila ndeci a tu wila kefetikilo. Momo vosi va songuilua le Espiritu lia Suku, ovo omãla va Suku"),
      LitanyContent(id: 159, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "", content: "Tu tumbulule a Yehova, Suku yolohoka. Tuisa ocipala cove, oco tu yovoke"),
      LitanyContent(id: 160, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "", content: "Ocipikipiki kua moleha ungelo wa Nãla, kuenje ocinyi ca tuila vokahondo. Ungelo wa popia laye hati, iña pimo. Wala olohaku viove, lisikilĩla: Ñuame"),
      LitanyContent(id: 161, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "", content: "Tu tumbulule a Yehova, Suku yolohoka. Tuisa ocipala cove, oco tu yovoke"),
      LitanyContent(id: 162, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "2Pet.3:13;Esit.21:3-4", content: "Puãi, mekonda liohuminyo yaye, tu lavoka ilu liokaliye, loluali luokaliye, omu mu kala esunga. Kuenje, nda yeva ondaka yinene ya tunda kocalo, ya linga yiti, tala, onjo ya Suku yi kasi pokati komanu. Eye o tunga lavo, va linga omanu vaye, kuenje Suku, eye muele o kala lavo, o linga Suku yavo. Eye o puenya asuelela osi kovaso avo. Okufa ka ku kalako vali, momo ovina viatete via pita"),
      LitanyContent(id: 163, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKU_LITAVELA, books: "", content: "Tu tumbulule a Yehova, Suku yolohoka. Tuisa ocipala cove, oco tu yovoke"),

      LitanyContent(id: 164, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "Isy. 55:6-7", content: "Sandi Yehova osimbu a sangiwa; u vilikiyi osimbu a kasi ocipepi.Ukuakandu a sie onjila yaye, lu wa sia esunga a litepe lovisimilo viaye ha tiuka ku Yehova kuenje eye u linga ohenda, a tiuke muele ku suku yetu, kuenje u muisa ongecelo yalua"),
      LitanyContent(id: 165, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "Osm.100:5", content: "Momo Yehova ukuahenda, kuenje ohenda yaye ka yi pui. Epandi liaye li enda ño hũ, toke kovitumbulukila viosi"),
      LitanyContent(id: 166, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "Isy.1:18;1Yoan.1:7", content: "Ndãno akandu ene a kusuka nge a ka yela ndocikokoto; ndãno a soka ndonanga yo husu, a yela ndutele. Nda tu endaila vocinyi, ndeci eye a kasi vocinyi, osonde ya Yesu Omõlaye yi tu yelisa kakandu osi"),
      LitanyContent(id: 167, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "1Yoan.1:8", content: "Nda tu linga tuti, akandu ka tu kuete, tu lilimbika, kuenda ocili vitima vietu ka cimo. Puãi nda tu litavela akandu etu, eye ukuacili, haeye ukuesunga, otu ecela akandu etu, o tu upa aviho osi"),
      LitanyContent(id: 168, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "Olosapo 28:13; 1Yoan.1:9;Osm32:1", content: "U o limbika akandu aye, ka tẽla oku sumulũha; puãi u o litavela, kuenje o tindukako, eye osanga ohenda. Oco tu litaveli akandu etu, momo wa sumuluha u okulueya kuaye kua ecelua, kuenda ekandu liaye lia tuvikiwa"),
      LitanyContent(id: 169, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "Osm. 32:5", content: "Nda litavela kokuove ekandu liange. Ongole yange sia yi limbikile. Nda linga siti, ndi litavela ku Yehova okulueya kuange, kuenje wa njupa eviho liekandu liange"),
      LitanyContent(id: 170, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "Yer.29:11-13;Alis.3:40-41", content: "Ca popia Yehova citi, Nda kuliha ovisimilo ndo simili, okuti viombembua, vieyambulo havioko, kuenje eci vu vilikiya kokuange ko kambi oku sanga, nda vu sandiliya lutima wene wosi. Oco tu konomuisi olonjila vietu loku vi seteka, ha tu tiuka ku Yehova. Itima vietu vi imbe ovaso ku Yehova, ukuailu"),
      LitanyContent(id: 171, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "Osm.51.1,10:139:24", content: "Ndinge ohenda, a Suku, omo o kasi locisola ka ci pui. Omo ohenda yove yalua, imula okulueya kuange. Sovuile utima u yela, a Suku. Tumbulula vokati kange espiritu liesunga. Songuile vonjila ka yi pui"),
      LitanyContent(id: 172, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "2Kor.5:21:Rom.6:11", content: "Una ka kulihile ekandu Suku wo lingisa ndekandu mekonda lietu, ha tu lingi vakuesunga lia Suku, mekonda liaye. Oco ene sokololi okuti, kakandu, wa fi, puãi wa muili omuenyo kopui ku Ñala Yesu Kristu, upopeli wene"),
      LitanyContent(id: 173, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "Efs.1:7", content: "Kokuaye tu kuete eyovo, olio ongecelo yakandu, ndukuasi walua wocali caye"),
      LitanyContent(id: 174, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YAPINGILO_AINI_AINI, books: "2Kor.9:15", content: "lekongelo: Pandu, pandu ku Suku mekonda liocali caye calua"),

      LitanyContent(id: 175, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOLOPANDU, books: "", content: "Tu panduli ku Suku, omo a lisituluila kokuetu pokati kovina via lua a popia loku linga, puãi ca piãla, omo a popia letu, Vomõlahe Yesu Kristu, Eye Onjovoli yetu, haeye wa tu lingila Onjila, Lesunga, Lomuenyo"),
      LitanyContent(id: 176, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOLOPANDU, books: "", content: "Pandu, pandu ku Suku, mekonda liohenda yahe yalua"),
      LitanyContent(id: 177, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOLOPANDU, books: "", content: "Tu panduli ku Suku, omo tu kasi lombangi yinene vovitima vietu, okuti Espiritu Sandu, lomo eye a kasi oku malusula vovitima vietu upange weyovo, lomo a tu muisa olondunge kuenda ongusu"),
      LitanyContent(id: 178, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOLOPANDU, books: "", content: "Pandu, pandu ku Suku, mekonda liohenda yahe yalua"),
      LitanyContent(id: 179, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOLOPANDU, books: "", content: "Tu panduli ku Suku, omo tu kasi lovisonehua viaye vi kola via linga ovela yolomãi vietu, havio vi tela oku tu imba onumbi yovina vieyovo,  levi viomuenyo ko pui. Tu pandulivo ndomo a tu katuila ava va tu situluila ondaka yaye yi kola, loku tu ilikila eyovo liaye liocili"),
      LitanyContent(id: 180, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOLOPANDU, books: "", content: "Pandu, pandu ku Suku, mekonda liohenda yahe yalua"),
      LitanyContent(id: 181, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOLOPANDU, books: "", content: "Tu panduli ku Suku ndomo tua yeva ekovongo liaye, lioku kuata kupange wahe u kola, woku linga olomunga viondaka yaye. Tu pandulivo ndomo kupange waco u kola tua linga muele olomunga viondaka yaye. Tu pandulivo ndomo okuti kupange waco tu kasi loku kuatisa calua ofeka yetu yo Ngola, loku amisako, pokati ketu, unene wekongelo liahe"),
      LitanyContent(id: 182, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOLOPANDU, books: "", content: "Pandu, pandu ku Suku, mekonda liohenda yahe yalua"),
      LitanyContent(id: 183, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOLOPANDU, books: "", content: "Tu panduli ku Suku ndomo okuti ka tu sile latatahãi, puãi wa tu sila ocihandeleko ca lomboloka ca Nãla Yesu hati, Kuendi kolofeka viosi loku longisa olondonge, haye wa tu sila ohuminyo yakolelua yiti, Nãsi kumue lene toke kesulilo lioluali"),
      LitanyContent(id: 184, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOLOPANDU, books: "", content: "Pandu, pandu ku Suku, mekonda liohenda yahe yalua"),

      LitanyContent(id: 185, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKUPINGA_UTOI, books: "Osm.46:1-2", content: "Suku eye ocikolo cetu haeye ongusu yetu. Eye oñuatisi, kohali omoleha lombili. Oco ka tu yokoka, ndaño oluali lu pongoloka, ndaño olomunda vi undumuhila vokati kokalunga"),
      LitanyContent(id: 186, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKUPINGA_UTOI, books: "Osam 23:1-3", content: "Yehova eye ungombo wange, ame si suki. O mekalaisa kovisenge vitalala. O songowaila kovava a tulumuha. O kavuluisa utima wange. O ngendaisa volonjila viesunga mekonda lionduko hahe"),
      LitanyContent(id: 187, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKUPINGA_UTOI, books: "Osm.27:1", content: "Yehova eye ocinyi cange, haeye epopelo liange. U njokokela helie? Yehova eye ongusu yomuenyo wange. Helie o ndingisa usumba?"),
      LitanyContent(id: 188, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKUPINGA_UTOI, books: "Osm. 23:4", content: "Ocili ndãno mita vomaka yulembo wokufa, lacimue cĩvi ndi ci yokokela, momo ove o kasi lame. Ohunya yove lombueti yove vi ndemba ndemba"),
      LitanyContent(id: 189, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKUPINGA_UTOI, books: "Osm. 91:1,2,11,12", content: "U wa tunga vociwundilo ca Fũ eye o tumala vulembo wa Tõlo. Nukula Yehova siti, eye ocikolo cange, haeye ombonge yange. Eye Suku yange, ndu kolela. Momo oku kundika kovangelo vaye, ha va ku lavi kolonjila viove viosi. Va ku yelula lovaka avo sanga o likonjoka omãi yove kewe"),
      LitanyContent(id: 190, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKUPINGA_UTOI, books: "Osm. 121:7-8", content: "Yehova oku vindikiya kuvi wosi, o vindikiya omuenyo wove. Yehova oku vindikiya, nda poku tunda, nda poku iñila, tunde opo toke ka ku ci"),
      LitanyContent(id: 191, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKUPINGA_UTOI, books: "Osm. 91.15-16", content: "Eci a mbilikiya, ndu tambulula. Nãla laye kotembo yohali. Ndu popela, ndu kemainya. Ndu muisa eyovo liange"),
      LitanyContent(id: 192, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKUPINGA_UTOI, books: "Osm.121:3-5", content: "Eye ka tava okuti omãi yove yi sieluha. U oku lava ka suñila. Ocili, ukuakulava Isareli ka suñila, ndanõ oku pekela. Yehova eye utati wove"),
      LitanyContent(id: 193, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOKUPINGA_UTOI, books: "Osm.119:1-3", content: "Ava va endela vonjila ya suñama, okuti vonjila yovihandeleko via Yehova, ovo va sumulũha. Ava va linga ovisila viaye, loku u vanjiliya lutima wavo wosi, haivo ka va lingi evĩho, puãi va endela volonjila viaye, ovo va sumuluha"),
      LitanyContent(id: 194, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOKUPINGA_UTOI, books: "Osm.119:5-6", content: "Ndi livela calua okuti olonjila viange vi loña koku linga ovisila viove. Momo, si kutisiwa osõi, nda ndi sumbila ovihandeliko viove viosi"),

      LitanyContent(id: 195, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.UCITO_WA_YESU, books: "", content: "Ulamba wi imbiwe ku Ñala yolonãla, u wa tumile oku yovola ava va likuminya oku linga ocipango cahe"),
      LitanyContent(id: 196, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.UCITO_WA_YESU, books: "", content: "Kalimi osi vo sivaye vati, Aleluya, Soma Yombembua"),
      LitanyContent(id: 197, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.UCITO_WA_YESU, books: "Luk. 1:32-33", content: "Eye o linga unene, o tukuiwa Mõla a Tõlo, kueje Yehova suku o wiha ocalo ca Isiaye Ndaviti. O viala nõ hu epata lia Yakomba, kuenje usoma waye ko sulila"),
      LitanyContent(id: 198, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.UCITO_WA_YESU, books: "", content: "Kalimi osi vo sivaye vati, Aleluya, Soma Yombembua"),
      LitanyContent(id: 199, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.UCITO_WA_YESU, books: "Luk. 1:37, 45,48-50", content: "Momo ka kuli ondaka yesanda, yi tunda ku suku. U wa kolela wa sumuluha, momo ovina Nãla a popia laye vi lingiwa. Tala, tunde opo, ovitumbulukila viosi vi nukula viti, wa sumuluha. Momo Fũ wa ndingila ovina vinene, kuenje onduko yaye yi kola. Ohenda yaye yi kasi lava vo sumbila, tunde kocitumbulukila toke kocitumbulukila cikuavo"),
      LitanyContent(id: 200, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.UCITO_WA_YESU, books: "", content: "Kalimi osi vo sivaye vati, Aleluya, Soma Yombembua"),
      LitanyContent(id: 201, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.UCITO_WA_YESU, books: "Hev.1:5-6,8;Isy.9:6", content: "Suku wa popia hati, Ove wumõlange. Etali nda ku cita, kuenda hati, ndinga Isiaye, leye o linga Omõlange. Eci o nena vali koluali nuñulu, o linga hati, Ovangelo vosi va Suku vo fendele. Ocalo cove, a Suku, coloneke ka vi pui. Epangati liesunga olio epandi liusoma wove. Isaya hati, Onduko yaye, o tukuiwa Cikomo, Ndunguli, Suku Eye Fû, Isia kapui, Soma yombembua"),
      LitanyContent(id: 202, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.UCITO_WA_YESU, books: "", content: "Kalimi osi vo sivaye vati, Aleluya, Soma Yombembua"),

      LitanyContent(id: 203, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.COVIANJA, books: "", content: "Kuenje owiñi, wo pitila kovaso, lu wo kuama konyima, vosi va vilikiya vati, Hosana kuMola a Daviti. U iyilila onduko ya Ñala a sivayiwe. Tu  fendeli Suku. Suku Espiritu kuenje ca sesamela ava vo fendaila oku u fendela lespiritu locili. Panduli Yehova, tukuli onduko yahe; sapuili omanu ovilinga viahe, wimbili ovisungo; wimbili ovisungo viesivayo; vanguli ovikomo viahe viosi; tiamisi ovitima viene ku Suku"),
      LitanyContent(id: 204, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.COVIANJA, books: "", content: "Ovitima vietu tu vi tiamisa ku Suku"),
      LitanyContent(id: 205, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.COVIANJA, books: "", content: "A Ñala, patulula ovaso etu"),
      LitanyContent(id: 206, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.COVIANJA, books: "", content: "Oco tu mole ovikomo viondaka yove"),
      LitanyContent(id: 207, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.COVIANJA, books: "", content: "A Ñala, situlula ovimela vietu"),
      LitanyContent(id: 208, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.COVIANJA, books: "", content: "Oco vovimela mu tunde esivayo liosi"),
      LitanyContent(id: 209, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.COVIANJA, books: "", content: "Sivayi Suku"),
      LitanyContent(id: 210, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.COVIANJA, books: "", content: "Onduko ya Suku yi sivayiwe"),

      LitanyContent(id: 211, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "", content: "Ulamba ku Suku Tate, lo k’Omolahe kuenda k’Espiritu Sandu"),
      LitanyContent(id: 212, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "", content: "Ndeci kefetikilo haico kotembo yilo, cenda ño hũ, Amen"),
      LitanyContent(id: 213, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "Luka 24:1,2", content: "Puãi keteke lia tete kosimanu eci kuaca omele akãi veya keleva, vambata onguendu ya pongiyiwa, yu va sanga ewe liaco lia tiñuluhako"),
      LitanyContent(id: 214, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "", content: "Aleluya"),
      LitanyContent(id: 215, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "Mat 28:8,9", content: "Kuenje akãi va tunda lombili keleva, lusumba, lonjolela ya lua, kuenje tala, Yesu wa ñualehela lavo, hati, kalungi!"),
      LitanyContent(id: 216, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "", content: "Aleluya!"),
      LitanyContent(id: 217, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "Yoano 20:11,13-15", content: "Puãi Mariya wa kala ño peleva loku lila. Eye wa popia hati, Vopamo Ñala yange kuenje siko oko vo kapa. Kuenje wa mola Yesu wa talama, puãi ka kulihile okuti eye Yesu. Eye wa soka hati ukuacumbo. Yesu wa popia lahe hati, A Mariya! Mariya wa ñualapo kuenje wa popia laye hati, Olongisi"),
      LitanyContent(id: 218, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "", content: "Aleluya"),
      LitanyContent(id: 219, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "Luka 24:13,15", content: "Kuenje tala, eteke liaco va vali vavo, va kala loku enda kimbo, limue, onduko yalio Emausi. Kuenje va kala loku vangula ovina viosi via lingiwa. Osimbu va kala loku vangula loku likumbolola, Yesu, eye muele, wa kokela ocipepi kuenje wa endela kumue lavo"),
      LitanyContent(id: 220, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "", content: "Aleluya"),
      LitanyContent(id: 221, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "Yoano 20:19,20", content: "Osimbu apito a yikilua usumba wa va Yundea, oco Yesu weya vohondo omu olondonge via kala. Wa talama pokati kavo yu wa popia lavo hati, ombembua yi kale lene. Eci a ci popia, wa va lekisa ovaka aye lepati liaye"),
      LitanyContent(id: 222, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "", content: "Aleluya"),
      LitanyContent(id: 223, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "Yoano 21:3,4,7", content: "Simono Petulu wa popia lolondonge hati, Ngenda ha pipa. Va popia laye vati, Etu tu endavo love. Uteke waco puãi ka va kuatele cimue. Eci kua ca, Yesu wa talama kongongo. Oco ondonge yina Yesu a sole ya popia la Petulu hati, O-o Ñala"),
      LitanyContent(id: 224, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "", content: "Aleluya"),
      LitanyContent(id: 225, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "Esituluilo 1:10, 12-15,17-18", content: "Nda kala ve Espiritu eteke lia Ñala, Nda yeva konyima yange ondaka yinene hutiño yolumbeta. Oco nda pukuka oku vanja kondaka ya popia lame. Eci nda pongoloka nda mola umue wa setahãla Omola Omunu, wa wala okapote ka sovĩ, toke kolomahi; wa litika vonulo luvia wulu. Utue waye u yela ndovoña omeme a yela ndocikokoto, haico ocifuko caye. Ovaso aye a moleha ndulienge wondalu. Ondaka yaye ya soka ndocileñi covava a lua. Eci ndo mola nda kupukila posi kolomai viaye ndu wa fa. Eye puãi wa ndamba londio yaye hati: Ku ka yokoke ño. Ame Tete, haime Kuasula, haime ñasi lomuenyo haime ñuete olosapi viokufa levi vionjembo"),
      LitanyContent(id: 226, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPASKUA, books: "", content: "Aleluya, Aleluya, Aleluya"),

      LitanyContent(id: 227, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "A Espiritu Usovoli, ove u Cime comuenyo locinyi, Ukuaku muisa oviali via Suku, Undembeleki, Uñolisi yovitima, haive Usongui wetu"),
      LitanyContent(id: 228, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "Ndo tu yeve a Espiritu Sandu, loku tu kuatisa"),
      LitanyContent(id: 229, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "A Espiritu wukulihiso lolondunge, wa tunda ku Isietu o kasi kilu, kuenda ku Yesu Omolahe, tu vanje lohenda loku tu songuila vocinyi cove, oco tu litepe lowelema, loku amamako oku kuatisa evi viove viocili"),
      LitanyContent(id: 230, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "Ndo tu yeve a Espiritu Sandu, loku tu kuatisa"),
      LitanyContent(id: 231, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "A Espiritu liocisola lohenda, ove wa ihiwile ca piãla ku Ñala Yesu Kristu, wa limolehisa pokati komuenyo wahe we lipua kilu lieve, lokalongiso ahe a longa kuenda kokufa kuahe kuoku tu yovola. Wa eca ulamba pokati kepinduko liahe. Tu yongola oku ku yuluila ovitima vietu"),
      LitanyContent(id: 232, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "Ndo tu yeve a Espiritu Sandu, loku tu kuatisa"),
      LitanyContent(id: 233, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "A Espititu ecaiwa lesanju kuvosi va lomba ku Suku Isietu, haive Ñala yetu Yesu Kristu a likuminya oku ku tuma kolondonge viahe, enju kokuetu, tumala letu, kuenda pokati kocali cove tu imule eviho liosi"),
      LitanyContent(id: 234, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "Ndo tu yeve a Espiritu Sandu, loku tu kuatisa"),
      LitanyContent(id: 235, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "A Espiritu Ukuonene, ndeci wa wila kekongelo kefetikilo, hu muisa vakuetuavo unene woku linga olombangi vionjovoli yetu, lepondolo lioku yula pokati kovitangi via lua, haico tu lombelavo ekongelo lia Kristu kulo ko Ngola, ko Afrika, lokolofeka viosi, oco kokualio kumolehe oku tua kuocinyi cove, kuenda unene wa Suku woku popela oluali luosi"),
      LitanyContent(id: 236, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "Ndo tu yeve a Espiritu Sandu, loku tu kuatisa"),
      LitanyContent(id: 237, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "A Espiritu, ove ukuakupitiya evi via Cime cetu Yesu Kristu, ndo tu situluile olondaka viahe viosi, loku vi tumalisa ciwa vovitima vietu. Sunguluisa ovipango vietu, kuenda yelisa ovitima vietu, ha tu yuka ocali cove lomuenyo wove, oco tu ime epako lia lua, lina li tumbangiya onduko yove yi kola"),
      LitanyContent(id: 238, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.YOPENDEKOSTE, books: "", content: "Ndo tu yeve a Espiritu Sandu, loku tu kuatisa"),

      LitanyContent(id: 239, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.LIETEKE_LIA_TETE_LIULIMA_WOKALIYE, books: "", content: "Eci oloneke viulima via tukuiwa viatela, keteke liatete kulima wokaliye tu litumbiki, kuenda tu lieci ku Yehova, oco a tu lekise esunga liahe eli lilaika oku tu tata, kuenda oku tu endisa ciwa vulima wokaliye a tuiha"),
      LitanyContent(id: 240, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.LIETEKE_LIA_TETE_LIULIMA_WOKALIYE, books: "", content: "(Tu sivaya Ñala yetu..., ocinimbu ca tete)"),
      LitanyContent(id: 241, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.LIETEKE_LIA_TETE_LIULIMA_WOKALIYE, books: "", content: "Poku enda kuetu vungende womuenyo wetu vulima ulo wokaliye, omo tua likuminya oku songuiwa londaka yahe, yu Muele Ñala Yesu hati, Ovitima viene ka vi ka tokotelue, koleli Suku Ñolelivo ame. Ocili mopia lene siti Ame ndinjila haime ndicili hame ndimuenyo. Lomue iya ku Tate te lame"),
      LitanyContent(id: 242, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.LIETEKE_LIA_TETE_LIULIMA_WOKALIYE, books: "", content: "(ocinimbu ca vali)"),
      LitanyContent(id: 243, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.LIETEKE_LIA_TETE_LIULIMA_WOKALIYE, books: "", content: "Etali eteke lia tete kulima. Umue wa kuliha ndomo ulaika oku kala? Te lika Yehova Suku. Omo liaco, liyelisi lohenda ya Yesu. Momo ukuesunga omola omuenyo omo liohenda yaye. Momo ekolelo olio ociseveto covina vilavokaiwa, halio ombangi yovina ka vi molaiha"),
      LitanyContent(id: 244, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.LIETEKE_LIA_TETE_LIULIMA_WOKALIYE, books: "", content: "(ocinimbu ca tatu)"),
      LitanyContent(id: 245, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.LIETEKE_LIA_TETE_LIULIMA_WOKALIYE, books: "", content: "Amala, akuenje, afeko, alume, akãi, akulu, lene amanu vosi, ka tu ka soli londaka lika pamue lelimi, te lovilinga kuenda locili. Nda tu ci linga, tu limbukiwa okuti tua tiamela kocili, kuenje tu tulila ovitima vietu kovaso aye, eci ovitima vietu vi tu veta ovelo. Momo Suku wa piãla, ovitima vietu vi sule kuenje eye wa kuliha cosi. A vakuacisola nda ovitima vietu ka vi tu veta evelo tu kala lutõi kovaso a Suku. Kuenje cosi tu pinga kokuahe tu ci tambula, momo tua pokola kovihandeleko viaye, loku linga ovina viu sanjuisa"),
      LitanyContent(id: 246, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.LIETEKE_LIA_TETE_LIULIMA_WOKALIYE, books: "", content: "(ocinimbu ca kuala)"),
      LitanyContent(id: 247, person: LitanyPerson.DIRECTOR, litanyTitle: UmLitanyTitleSeeder.LIETEKE_LIA_TETE_LIULIMA_WOKALIYE, books: "", content: "Ocihandeleko caye ceci okuti, tu kolela onduko y`Omolaye Yesu Kristu, loku lisola pokati ndeci a tu handeleka. Wosi o pokola kovindeleko via Suku, o kala wa Suku, kuenje Suku o kalavo lahe. Tua kuliha okuti eye o kasi vokuetu momo wa tu iha Espiritu liaye likola. Ámen"),
      LitanyContent(id: 248, person: LitanyPerson.CONGREGATION, litanyTitle: UmLitanyTitleSeeder.LIETEKE_LIA_TETE_LIULIMA_WOKALIYE, books: "", content: "(ocinimbu ca talo)"),

    ];
  }
}